import React from 'react';
import First from '../components/First_Main';
const ThreeColumn = () => {
  return (
    <div
      style={{
        display: 'grid',
        gridTemplateColumns: 'repeat(3, 1fr)',
        gridGap: 20
      }}
    >
      <div
        style={{
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center'
        }}
      >
        <First />
      </div>
      <div>Column 2</div>
      <div>Column 3</div>
    </div>
  );
};

export default ThreeColumn;
